import React, { useState, useEffect } from 'react';
import { GetVehicleInformation } from '../../../interfaces/BackendCalls';

import SearchBox from '../Common/SearchBox';

function ShowVehicleInformation(props) {

    const [modelYearsList, setModelYearsList] = useState(null);

    useEffect(() => {
        GetVehicleInformation(props.vehicleType.id, props.manufacturer.Value, props.model.Value, props.modelYear.Value).then((result) => result["Anos"].length > 0 ? setModelYearsList(result["Anos"]) : null);
    }, [props.vehicleType, props.manufacturer, props.model.Value, props.modelYear.Value]);

    console.log("modelYearsList", modelYearsList);

    return (

        <div>
            <ShowBox setOption={props.setModelYear} itemsList={modelYearsList} placeholder="Digite o Modelo"/>
        </div>
    )

}

export default ShowVehicleInformation;
